swaptrade_modal_desc_crosschain_valuedif:
Las comisiones que se tienen en cuenta para obtener la diferencia de valor de este swap cross-chain son:
• La comisión de bridge cross-chain: {bridgePriceAndFee}
• La comisión de red de la blockchain de destino: {toChainPriceAndFee}
• Hacer trading de una determinada cantidad de tokens afecta a la profundidad del pool de liquidez. Esto, a su vez, cambia la disponibilidad general y el precio de los tokens, lo que provoca diferencias significativas en los precios..

swaptrade_mid_dialog_desc_est_network_fe:
En transacciones cross-chain, esta comisión incluye las comisiones de red de la blockchain de pago del token y del bridge cross-chain.

La comisión de esta transacción se muestra de la siguiente manera:
· Comisión de red de la blockchain {chain}:{value1}
· Comisión de red del bridge {bridge}: {value2}

Las comisiones de red las pagan los mineros y nuestra plataforma no las cobra.

swaptrade_intro_dialog_desc_cross_value_:
La diferencia de valor de esta transacción se muestra de la siguiente manera:
· Comisión de red de la blockchain {chain}: {value1}
· Comisión del bridge {bridge}: {value2}

Si la diferencia de valor es muy grande, pero las comisiones que aparecen más arriba son relativamente pequeñas, esto se debe a que la cantidad del swap ha afectado a la profundidad del pool de liquidez del par de tokens.

swaptrade_intro_tooltip_trade_including_:
En los swaps cross-chain, el coste incluye las comisiones de red de la red de pago y una parte de las comisiones del bridge cross-chain. Desglose de comisiones de esta transacción:
• Comisión de red: {fromChainPriceAndFee}

• Comisión de bridge cross-chain:{bridgePriceAndFee}
La comisión de red cubre el coste de los mineros y no las cobra nuestra plataforma

